import React from "react";

const students = [
    {
        name: "1",
    },
    {
        name: "2",
    },
    {
        name: "3",
    },
    {
        name: "4",
    },
    {
        name: "5",
    },
];

function AttendanceBook(props) {
    return (
        <ul>
            {students.map((students) => {
                return <li>{students.name}</li>
            })}
        </ul>
    );
}

export default AttendanceBook;
